function format_struct_data(children, structs_datas) {
    // 添加每个单位的颜色
    for (var prop in children) {
        var index = Math.floor(Math.random() * 20);
        var value = 1;
        if (children[prop].value !== 0) {
            value = children[prop].value;
        }
        var tmp = {
            itemStyle: {
                normal: {
                    color: struct_colors[index],
                },
            },
            name: children[prop].name,
            children: [],
            value: children[prop].value,
        };
        format_struct_data(children[prop].children, tmp.children);
        if (tmp.children.length === 0) {
            delete tmp.children;
        }
        structs_datas.push(tmp);
        // return structs_datas;
    }
}


function format_struct_data_image(children, structs_datas) {
    // 添加每个单位的颜色
    for (var prop in children) {
        var index = Math.floor(Math.random() * 20);
        var value = 1;
        if (children[prop].value !== 0) {
            value = children[prop].value;
        }
        var tmp = {
            itemStyle: {
                normal: {
                    color: struct_colors[index],
                },
            },
            name: children[prop].name,
            children: [],
            value: children[prop].value,
            img: children[prop].imageBase64
        };
        format_struct_data_image(children[prop].children, tmp.children);
        if (tmp.children.length === 0) {
            delete tmp.children;
        }
        structs_datas.push(tmp);
        // return structs_datas;
    }
}
